import React, {Component} from 'react';

import {InputText} from 'primereact/inputtext';
import {InputTextarea} from 'primereact/inputtextarea';
import {Button} from 'primereact/button';
import {OrganizationChart} from 'primereact/organizationchart';

class Sample extends Component {    
    constructor() {
        super();
        this.state = {
            data: [{
                label: 'F.C Barcelona',
                expanded: true,
                children: [
                    {
                        label: 'F.C Barcelona',
                        expanded: true,
                        children: [
                            {
                                label: 'Chelsea FC'
                            },
                            {
                                label: 'F.C. Barcelona'
                            }
                        ]
                    },
                    {
                        label: 'Real Madrid',
                        expanded: true,
                        children: [
                            {
                                label: 'Bayern Munich'
                            },
                            {
                                label: 'Real Madrid'
                            }
                        ]
                    }
                ]
            }]      
        };
    }

    render() {
        return (
            <div>          
                <h1> 
                    <i className='fas fa-home'/> Sample
                </h1>  

                <OrganizationChart value={this.state.data}></OrganizationChart>

                <div className="p-grid p-fluid"> 
                    <div className="p-col-12 p-md-12">
                        <InputText placeholder="Name"/>
                    </div>

                    <div className="p-col-12 p-md-12">                        
                        <InputTextarea rows={13} cols={30} placeholder="Your Message" autoResize={true} />
                    </div>

                    <div className="p-col-12 p-md-2" style={{textAlign:'center'}} >
                        <Button 
                            label="Save"  
                            style={{
                                marginBottom:'10px',
                                border:'#663399', 
                                backgroundColor:'#663399', 
                                color: 'white'}} 
                            className="p-button-secondary"/>
                    </div>
                    <div className="p-col-12 p-md-2" style={{textAlign:'center'}}>
                        <Button 
                            label="Cancel" 
                            style={{
                                marginBottom:'10px',
                                border:'#8a4baf', 
                                backgroundColor:'#8a4baf', 
                                color: 'white'}} 
                            className="p-button-secondary" />
                    </div>
                </div>      
            </div>
        )
    }
}

export default Sample;
